import React from 'react'
import styles from "./Main.module.css"
const Main = () => {
    return (
        <div className={styles.Main}>
            <h1 className={styles.text}>Luxury & Sport Car Rental Service in Dubai</h1>
          
        </div>
    )
}

export default Main
